import React from "react";

const Biographie = () => {
    function randomYellow(r) {
        document.getElementById("#" + r).style.backgroundColor =
            "rgb(255, 200, 60)";
    }
    return (
        <div className="Biographie modules">
            {randomYellow(Math.floor(Math.random() * 10))}
            <p>
                <span className="marquee">
                    <span id="1">
                        Je suis un développeur de qualité qualitatif{" "}
                    </span>{" "}
                    -<span id="2"> J'apprends plus vite que mon ombre </span> -
                    <span id="3"> Je suis passionné</span> -
                    <span id="4"> Je suis motivé </span>-
                    <span id="5"> Je ne pratique pas le krav maga </span> -
                </span>
                <span className="marquee2">
                    <span id="1">
                        Je suis un développeur de qualité qualitatif{" "}
                    </span>{" "}
                    -<span id="2"> J'apprends plus vite que mon ombre </span> -
                    <span id="3"> Je suis passionné</span> -
                    <span id="4"> Je suis motivé </span>-
                    <span id="5"> Je ne pratique pas le krav maga </span> -
                </span>
            </p>
        </div>
    );
};

export default Biographie;
